pragma solidity 0.4.19;

library SafeMath {

  function mul(uint256 a, uint256 b) internal pure returns (uint256) {
    if (a == 0) {
      return 0;
    }
    uint256 c = a * b;
    assert(c / a == b);
    return c;
  }

  function div(uint256 a, uint256 b) internal pure returns (uint256) {
    // assert(b > 0); // Solidity automatically throws when dividing by 0
    uint256 c = a / b;
    // assert(a == b * c + a % b); // There is no case in which this doesn't hold
    return c;
  }

  function sub(uint256 a, uint256 b) internal pure returns (uint256) {
    assert(b <= a);
    return a - b;
  }

  function add(uint256 a, uint256 b) internal pure returns (uint256) {
    uint256 c = a + b;
    assert(c >= a);
    return c;
  }
}

contract owned {
    address public owner;

    function owned() public {
        owner = msg.sender;
    }

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    function transferOwnership(address newOwner) onlyOwner public {
        owner = newOwner;
    }

}

interface tokenRecipient { function receiveApproval(address _from, uint256 _value, address _token, bytes _extraData) public; }

contract Token {

    function totalSupply() constant returns (uint256 supply) {}
    function balanceOf(address _owner) constant returns (uint256 balance) {}
    function transfer(address _to, uint256 _value) returns (bool success) {}
    function transferFrom(address _from, address _to, uint256 _value) returns (bool success) {}
    function approve(address _spender, uint256 _value) returns (bool success) {}
    function allowance(address _owner, address _spender) constant returns (uint256 remaining) {}

    event Transfer(address indexed _from, address indexed _to, uint256 _value);
    event Approval(address indexed _owner, address indexed _spender, uint256 _value);
}

contract StandardToken is Token {

    using SafeMath for uint256;

    function transfer(address _to, uint256 _value) returns (bool success) {
        if (balances[msg.sender] >= _value && _value > 0) {
            balances[msg.sender] = balances[msg.sender].sub(_value);
            balances[_to] = balances[_to].add(_value);
            Transfer(msg.sender, _to, _value);
            return true;
        } else { return false; }
    }

    function transferFrom(address _from, address _to, uint256 _value) returns (bool success) {
        if (balances[_from] >= _value && allowed[_from][msg.sender] >= _value && _value > 0) {
            balances[_to] = balances[_to].add(_value);
            balances[_from] = balances[_from].sub(_value);
            allowed[_from][msg.sender] = allowed[_from][msg.sender].sub(_value);
            Transfer(_from, _to, _value);
            return true;
        } else { return false; }
    }

    function balanceOf(address _owner) constant returns (uint256 balance) {
        return balances[_owner];
    }

    function approve(address _spender, uint256 _value) returns (bool success) {
        allowed[msg.sender][_spender] = _value;
        Approval(msg.sender, _spender, _value);
        return true;
    }

    function approveAndCall(address _spender, uint256 _value, bytes _extraData) public returns (bool success) {
        tokenRecipient spender = tokenRecipient(_spender);
        if (approve(_spender, _value)) {
            spender.receiveApproval(msg.sender, _value, this, _extraData);
            return true;
        }
    }

    function allowance(address _owner, address _spender) constant returns (uint256 remaining) {
      return allowed[_owner][_spender];
    }

    function burn(uint256 _value) public returns (bool success) {
        require(balances[msg.sender] >= _value);
        balances[msg.sender] = balances[msg.sender].sub(_value);
        totalSupply = totalSupply.sub(_value);
        Burn(msg.sender, _value);
        return true;
    }

    function burnFrom(address _from, uint256 _value) public returns (bool success) {
        require(balances[_from] >= _value);
        require(_value <= allowed[_from][msg.sender]);
        balances[_from] = balances[_from].sub(_value);
        allowed[_from][msg.sender] = allowed[_from][msg.sender].sub(_value);
        totalSupply = totalSupply.sub(_value);
        Burn(_from, _value);
        return true;
    }
    event Burn(address indexed from, uint256 value);
    mapping (address => uint256) balances;
    mapping (address => mapping (address => uint256)) allowed;
    uint256 public totalSupply;
}

contract myToken10 is owned,StandardToken {

    using SafeMath for uint256;

    function () {
        //if ether is sent to this address, send it back.
        throw;
    }

    /* Public variables of the token */
    uint256 public supplyAmount = 10000000;
    string  public name;
    uint8   public decimals;
    string  public symbol;

    uint256 public sellPrice = 6000;
    uint256 public buyPrice = 6000;

    uint256 public availableSupply = 60000;

    mapping (address => bool) public frozenAccount;
    event FrozenFunds(address target, bool frozen);
    event Buy(address _buyer, uint256 _fund);
    event Sell(address _seller, uint256 _fund, uint256 _sellPrice);
    event Send(address _from, address _to, uint256 _amount);

    function myToken10(
        ) {
        totalSupply = supplyAmount;
        balances[owner] = totalSupply;
        name = "TOK10";
        decimals = 18;
        symbol = "TOK10";
        availableSupply = 0;
    }

    function _transfer(address _from, address _to, uint256 _value) internal {
        require (_to != 0x0);                                                   // Prevent transfer to 0x0 address. Use burn() instead
        require (balances[_from] >= _value);                                    // Check if the sender has enough
        require (balances[_to].add(_value) > balances[_to]);                    // Check for overflows
        require(!frozenAccount[_from]);                                         // Check if sender is frozen
        require(!frozenAccount[_to]);                                           // Check if recipient is frozen
        balances[_from] = balances[_from].sub(_value);                          // Subtract from the sender
        balances[_to] = balances[_to].add(_value);                              // Add the same to the recipient
        Transfer(_from, _to, _value);
    }

    function mintToken(address target, uint256 mintedAmount) onlyOwner public {
        balances[target] = balances[target].add(mintedAmount);
        totalSupply = totalSupply.add(mintedAmount);
        Transfer(0, this, mintedAmount);
        Transfer(this, target, mintedAmount);
    }

    function freezeAccount(address target, bool freeze) onlyOwner public {
        frozenAccount[target] = freeze;
        FrozenFunds(target, freeze);
    }

    function setPrices(uint256 newSellPrice, uint256 newBuyPrice) onlyOwner public {
        sellPrice = newSellPrice;
        buyPrice = newBuyPrice;
    }

    function setAvailableSupply(uint256 _value) onlyOwner public {
        require (balances[owner] >= _value);
        availableSupply = _value;
    }

    function buy(address _buyer, uint256 _amount) public {
        require(availableSupply > 0);
        require(availableSupply >= availableSupply.sub(_amount));
        require(balances[owner] >= _amount);
        availableSupply = availableSupply.sub(_amount);
        _transfer(owner, _buyer, _amount);
        Buy(_buyer, _amount);
    }

    function sell(address _seller, uint256 _amount) public {
        require(balances[owner] >= _amount);
        _transfer(_seller, owner, _amount);
        Sell(_seller, _amount, sellPrice);                                       // prove the current sellPrice
    }

    function send(address _from, address _to, uint256 _amount) public {
        _transfer(_from, _to, _amount);
        Send(_from, _to, _amount);
    }

    uint256 public divResult;
    uint256 public mulResult;

    function divTest(uint256 _value) public returns (uint256 _sellResult) {
      divResult = sellPrice.div(_value);
      return divResult;
    }
    function mulTest(uint256 _value) public returns (uint256 _buyResult) {
      mulResult = buyPrice.mul(_value);
      return mulResult;
    }
}
